import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(theme => ({
    root: {
        width: "100%",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        height: "100%",
        [theme.breakpoints.up("md")]: {
            justifyContent: "center",
            alignItems: "center",
        },
        "& p": {
            textAlign: "center"
        },
    },
    title: {
        textAlign: "center",
    },
    subTitle: {
        margin: 0,
        fontWeight: "bold",
        fontSize: "14px",
    },
    subTitleLinkChangeEmail: {
        fontWeight: 700,
    },
    emails: {
        display: "flex",
        alignItems: "baseline",
        marginBottom: "9px",
        fontWeight: "bold"
    },
    cursor: {
        cursor: "pointer",
    },
    link: {
        marginTop: "4px",
        marginBottom: theme.spacing(6),
    },
    textCodeField: {
        margin: theme.spacing(2),
        ["& fieldset"]: {
            borderRadius: 10,
            height: 40,

        },
        "& .MuiInputBase-input": {
            fontSize: "14px",
            height: 6,
        }
    }

}));
export default useStyles;
